F'kull belt jew raħal jew irħajjel Malti u Għawdxi ssib statwa meqjusa jew ta' raġel jew ta' mara. Aktarx din l-istatwa, jgħożżuha u jdawruha b'deheb u ġawhar u din l-istatwa darba f'sena, jekk ma tkunx xita, toħroġ iddur fit-toroq tal-belt jew raħal jew rħajjel. Ikun hemm tiżjin fit-toroq, daqq ta' baned, sparar ta' bombi u logħob tan-nar. Mhux kulħadd jaqbel: hemm min jgħid ħela ta' żmien, hemm min jistqarr aljenazzjoni, hemm min jgħid injuranza, oħrajn tradizzjoni, oħrajn devozzjoni u oħrajn 
..........
 li ħareġ fis-sena 1965. Qatt ħsibt fl-artist li ħadem l-istatwa ? Qatt interessajt ruħek fin-nies ta' qablek li ħallsu għalik bil-qalb ? Ġieli għaddielek minn moħħok kemm familji jiltaqgħu għall-festi u jġeddu l-ħbiberiji ? U Maltin u Għawdxin li jgħixu barra minn arthom u li jiġu għall-festi jifirħu, jiltaqgħu mal-familja ħajja u jerġgħu lura f'pajjiżhom. Kemm fiha tifsira dik l-istatwa għan-nies, kemm tqanqal nies u ħwejjeġ u ekonomija, ilbies, ikel, tibjid, tisjir, dwal. Barrani jaf jgħożż;
